import {SwapSvg} from '../Icons/Swap'
import {LogoutSvg} from '../Icons/Logout'
import {SettingsSvg} from '../Icons/Settings'
import {ShieldDoneSvg} from '../Icons/Shield'

export const accountSettings = [
    {
        name: 'change_account',
        icon: SwapSvg
    },
    {
        name: 'settings',
        icon: SettingsSvg
    },
    {
        name: 'order_records',
        icon: ShieldDoneSvg
    },
    {
        name: 'logout',
        icon: LogoutSvg
    }
]
